import './insertMovie.css'
import { useNavigate } from "react-router-dom";


function InsertMovie(props){
    let navigate = useNavigate(); 
    function dialog(){
        const favDialog = document.getElementById('favDialog');
        if(favDialog!= null)
            favDialog.showModal();
    }
    function navi(){

        navigate(`/Movie/${data.mId}?room=${Math.floor(Math.random() * 10000)}`)
    }
    function close(){
        const favDialog = document.getElementById('favDialog');
        if(favDialog!= null)
            favDialog.hidden = true;
    }
    const data = props.data;
    var image = (`../images/${data.image}`);
    console.log(image);
    return(
        <div className="col-6 col-xl-4  mb-2">
            <img className="main-img" src= {require("../images/spider-man.png")} onClick={() => dialog()} />
            {dialog()}
            <dialog id="favDialog">
                <form method="dialog">
                    <button onClick={() => navi()}>watch Online</button>
                    <button onClick={() => navi()}>watch with friends</button>
                    <button  value="cancel">Close</button>
                </form>
            </dialog>
            <output></output>
            <div>
                <label>{data.title}</label>
            </div>

        </div>

    )

};

export default InsertMovie;
